(7,	'সৈয়দ ওয়ালীউল্লাহ',	'সৈয়দ ওয়ালীউল্লাহ',	'সৈয়দ ওয়ালীউল্লাহ',	'লেখক',	'',	'',	'',	NULL,	'1',	NULL,	'2023-05-03 03:51:48',	'2023-05-03 03:51:48'),
(8,	'কাজী নজরুল ইসলাম',	'কাজী নজরুল ইসলাম',	'কাজী নজরুল ইসলাম (২৪ মে ১৮৯৯ – ২৯ আগস্ট ১৯৭৬; ১১ জ্যৈষ্ঠ ১৩০৬ – ১২ ভাদ্র ১৩৮৩ বঙ্গাব্দ) বিংশ শতাব্দীর প্রধান বাঙালি কবি ও সঙ্গীতকার। তার মাত্র ২৩ বছরের সাহিত্যিক জীবনে সৃষ্টির যে প্রাচুর্য তা তুলনারহিত। সাহিত্যের নানা শাখায় বিচরণ করলেও তার প্রধান পরিচয় তিনি কবি।\r\n\r\nতার জীবন শুরু হয়েছিল অকিঞ্চিতকর পরিবেশে। স্কুলের গণ্ডি পার হওয়ার আগেই ১৯১৭ খ্রিষ্টাব্দে তিনি ব্রিটিশ ভারতীয় সেনাবাহিনীতে যোগ দিয়েছিলেন। মুসলিম পরিবারের সন্তান এবং শৈশবে ইসলামী শিক্ষায় দীক্ষিত হয়েও তিনি বড় হয়েছিলেন একটি ধর্মনিরপেক্ষ সত্তা নিয়ে। একই সঙ্গে তার মধ্যে বিকশিত হয়েছিল একটি বিদ্রোহী সত্তা। ১৯২২ খ্রিস্টাব্দে ব্রিটিশ সরকার তাকে রাজ্যদ্রোহিতার অপরাধে কারাবন্দী করেছিল। তিনি ব্রিটিশ সাম্রাজ্যের অধীন অবিভক্ত ভারতের বিদ্রোহী কবি হিসেবে পরিচিত হয়েছিলেন।\r\n\r\nযে নজরুল সুগঠিত দেহ, অপরিমেয় স্বাস্থ্য ও প্রাণখোলা হাসির জন্য বিখ্যাত ছিলেন, ১৯৪২ খ্রিষ্টাব্দে তিনি মারাত্মকভাবে স্নায়বিক অসুস্থতায় আক্রান্ত হয়ে পড়লে আকস্মিকভাবে তার সকল সক্রিয়তার অবসান হয়। ফলে ১৯৭৬ খ্রিষ্টাব্দে মৃত্যু অবধি সুদীর্ঘ ৩৪ বছর তাকে সাহিত্যকর্ম থেকে সম্পূর্ণ বিচ্ছিন্ন থাকতে হয়। বাংলাদেশ সরকারের প্রযোজনায় ১৯৭২ খ্রিষ্টাব্দে তাকে সপরিবারে কলকাতা থেকে ঢাকা স্থানান্তর করা হয়। ১৯৭৬ সালে তাকে বাংলাদেশের জাতীয়তা প্রদান করা হয়। এখানেই তিনি মৃত্যুবরণ করেন।\r\n\r\nবিংশ শতাব্দীর বাঙালির মননে কাজী নজরুল ইসলামের মর্যাদা ও গুরুত্ব অপরিসীম। বাংলাদেশে তাকে “জাতীয় কবি“ হিসাবে মর্যাদা দেওয়া হয়। তার কবিতা ও গানের জনপ্রিয়তা বাংলাভাষী পাঠকের মধ্যে তুঙ্গস্পর্শী। তার মানবিকতা, ঔপনিবেশিক শোষণ ও বঞ্চনার বিরুদ্ধে দ্রোহ, ধর্মীয়গোঁড়ামির বিরুদ্ধতা বোধ এবং নারী-পুরুষের সমতার বন্দনা গত প্রায় একশত বছর যাবৎ বাঙালির মানসপীঠ গঠনে ভূমিকা রেখে চলেছে।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-05-03 06:28:03',	'2023-07-26 05:28:37'),
(9,	'Safina Simi',	'Writer',	'It brings me joy to write stories for children that transport them to worlds filled with magic and wonder.Through my stories, I aim to nurture imagination, inspire curiosity, and instill valuable life lessons. Every character I create holds a piece of my heart, and I hope they resonate with you as they do with me.',	'Author',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-03 06:26:51',	'2023-07-17 21:58:42'),
(10,	'শরৎচন্দ্র চট্টোপাধ্যায়',	'শরৎচন্দ্র চট্টোপাধ্যায়',	'শরৎচন্দ্র চট্টোপাধ্যায়\r\n\r\nশরৎচন্দ্র চট্টোপাধ্যায় ছিলেন একজন প্রখ্যাত বাঙালি সাহিত্যিক।  তিনি ১৮৭৬ খ্রিস্টাব্দের ১৫ সেপ্টেম্বর ব্রিটিশ ভারতের প্রেসিডেন্সি বিভাগের হুগলি জেলার দেবানন্দপুর গ্রামে এক দরিদ্র ব্রাহ্মণ পরিবারে জন্মগ্রহণ করেন। তাঁর পিতার নাম মতিলাল চট্টোপাধ্যায় ও মাতার নাম ভুবনমোহিনী দেবী। পাঁচ ভাই-বোনের মধ্যে শরৎচন্দ্র ছিলেন দ্বিতীয়। তাঁর দিদি অনিলা দেবী ছাড়াও প্রভাসচন্দ্র ও প্রকাশচন্দ্র নামে তাঁর দুই ভাই ও সুশীলা দেবী নামে তাঁর এক বোন ছিল। শরৎচন্দ্রের ডাকনাম ছিল ন্যাঁড়া। দারিদ্র্যের কারণে মতিলাল স্ত্রী ও সন্তানদের নিয়ে ভাগলপুরেশ্বশুরবাড়িতে থাকতেন বলে শরৎচন্দ্রের শৈশবের অধিকাংশ সময় এই শহরেই কেটেছিল।  আর তার সাহিত্যকর্মের জন্যে পাঠকের কাছে তিনি \'অপরাজেয় কথাশিল্পী\' নামে কথিত হন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-18 05:27:54',	'2023-07-18 23:30:48'),
(11,	'বঙ্কিমচন্দ্র চট্টোপাধ্যায়',	'N/A',	'বাংলা গদ্যের সম্রাট বলা হয় বঙ্কিমচন্দ্র চট্টোপাধ্যায়কে। তার হাতেই প্রথম বাংলা কথাসাহিত্য সাবালক হয়ে ওঠে। নিজস্ব চিন্তা ও সময়কালকে তিনি চিত্রিত করেছেন তার অসামান্য সব লেখায়। তিনি হুগলি কলেজে অধ্যয়নকালে ঈশ্বরচন্দ্র গুপ্তের সংবাদ প্রভাকর ও সংবাদ সাধুরঞ্জনে লেখা শুরু করেন। তার অনেক লেখা এই দুই পত্রিকায় প্রকাশিত হয়। পড়া শেষ করে সরকারি চাকরিতে যোগদান করেন। তিনি সারা জীবন তিনি অত্যন্ত নিষ্ঠার সাথে কাজ করেছেন। তিনি বঙ্গদর্শন পত্রিকার প্রতিষ্ঠাতা সম্পাদক ছিলেন। কমলাকান্ত ছদ্মনামেও লিখতেন তিনি। তার প্রকাশিত উল্লেখযোগ্য গ্রন্থ হলো- দুর্গেশনন্দিনী, কপালকুণ্ডলা, কৃষ্ণকান্তের উইল,দেবী চৌধুরানী, আনন্দমঠ।',	'লেখক',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-18 05:49:46',	'2023-07-18 05:50:25'),
(12,	'জীবনানন্দ দাশ',	'জীবনানন্দ দাশ',	'জীবনানন্দ দাশ\r\nজন্ম-(ফেব্রুয়ারি ১৮, ১৮৯৯ - বঙ্গাব্দ ফাল্গুন ৬, ১৩০৫ - কার্তিক ৫, ১৩৬১) ছিলেন বিংশ শতাব্দীর অন্যতম প্রধান আধুনিক বাঙালি কবি, লেখক, প্রাবন্ধিক এবং অধ্যাপক। তাকে বাংলাভাষার \"শুদ্ধতম কবি\" বলে আখ্যায়িত করা হয়ে থাকে। তিনি বাংলা কাব্যে আধুনিকতার পথিকৃতদের মধ্যে অগ্রগণ্য। মৃত্যুর পর থেকে শুরু করে বিংশ শতাব্দীর শেষ ধাপে তিনি জনপ্রিয়তা পেতে শুরু করেন এবং ১৯৯৯ খ্রিস্টাব্দে যখন তার জন্মশতবার্ষিকী পালিত হচ্ছিল ততদিনে তিনি বাংলা সাহিত্যের জনপ্রিয়তম কবিতে পরিণত হয়েছেন। তিনি প্রধানত কবি হলেও বেশ কিছু প্রবন্ধ-নিবন্ধ রচনা ও প্রকাশ করেছেন। তবে ১৯৫৪ খ্রিস্টাব্দে অকাল মৃত্যুর আগে তিনি নিভৃতে ২১টি উপন্যাস এবং ১০৮টি ছোটগল্প রচনা গ্রন্থ করেছেন যার একটিও তিনি জীবদ্দশায় প্রকাশ করেননি। তাঁর জীবন কেটেছে চরম দারিদ্রের মধ্যে। বিংশ শতাব্দীর শেষার্ধকাল অনপনেয়ভাবে বাংলা কবিতায় তাঁর প্রভাব মুদ্রিত হয়েছে। রবীন্দ্র-পরবর্তীকালে বাংলা ভাষার প্রধান কবি হিসাবে তিনি সর্বসাধারণ্যে স্বীকৃত। তাকে বাংলাভাষার শুদ্ধতম কবি অভিধায় আখ্যায়িত করা হয়েছে। তিনি (অক্টোবর ২২, ১৯৫৪ -বঙ্গাব্দ কার্তিক ৫, ১৩৬১ ) সালে মৃত্যু বরণ করেন।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-24 22:57:22',	'2023-07-24 22:57:22'),
(13,	'অক্ষয়চন্দ্র সরকার',	'অক্ষয়চন্দ্র সরকার',	'অক্ষয়চন্দ্র সরকার (জন্ম: ১১ ডিসেম্বর ১৮৪৬ – মৃত্যু: ২ অক্টোবর ১৯১৭) ছিলেন ঊনবিংশ শতাব্দীর বিশিষ্ট বাঙালি কবি, প্রাবন্ধিক ও সাহিত্য সমালোচক। রায়বাহাদুরের পুত্র হয়েও ব্রিটিশ-বিরোধী আন্দোলনের প্রবল সমর্থক অক্ষয়চন্দ্র দেশীয় শিল্পের পুনরুজ্জীবন ও স্বায়ত্তশাসনের উপযোগী শিক্ষাব্যবস্থা প্রবর্তনের পক্ষপাতী ছিলেন।\r\nঅক্ষয়চন্দ্রে জন্ম বর্তমান হুগলি জেলার চুঁচুড়ার কদমতলায়। পিতা ছিলেন সেযুগের বিশিষ্ট কবি ও সাহিত্যিক রায়বাহাদুর গঙ্গাচরণ সরকার। শিক্ষা প্রথমে হুগলি কলেজিয়েট স্কুল ও পরে কলকাতার প্রেসিডেন্সী কলেজে। কর্মজীবনে প্রথমে বহরমপুরে ও পরে চুঁচুড়ায় ওকালতি করতেন। প্রথম যৌবনে বঙ্কিমচন্দ্র চট্টোপাধ্যায় সম্পাদিত বঙ্গদর্শন পত্রিকায় লেখালেখি শুরু করেন। ১৮৭২ সালে বঙ্গদর্শনের প্রথম সংখ্যায় তার উদ্দীপনা নামে একটি প্রবন্ধ প্রকাশিত হয়।\r\nঅক্ষয়চন্দ্র ১৮৭২ সালে মাসিক নবজীবন ও ১৮৭৩ সালে সাপ্তাহিক সাধারণী নামে দুটি পত্রিকা প্রকাশ করেন। নবজীবন চলেছিল ১৮৭৮ সাল অবধি। হেমচন্দ্র বন্দ্যোপাধ্যায়, নবীনচন্দ্র সেন, রবীন্দ্রনাথ ঠাকুর ও রামেন্দ্রসুন্দর ত্রিবেদীর মতো লেখকেরা এই জনপ্রিয় চিন্তাশীল পত্রিকাটিতে লেখালেখি করেন। রামেন্দ্রসুন্দরের প্রথম বাংলা রচনা এই পত্রিকাতেই প্রকাশিত হয়। চুঁচুড়া থেকে প্রকাশিত সাধারণী পত্রিকাটির উদ্দেশ্য ছিল রাজনৈতিক আলোচনা ও হিন্দুসমাজের মূল দৃঢ় করা। বঙ্কিমচন্দ্র চট্টোপাধ্যায়, ইন্দ্রনাথ বন্দ্যোপাধ্যায়, বঙ্গবাসী পত্রিকার যোগেন্দ্রচন্দ্র বসু প্রমুখ প্রথম সারির সাহিত্যিকের রচনা এই পত্রিকায় প্রকাশিত হত।\r\n\r\n১৮৭৪ সালে গোচারণের মাঠ নামে একটি যুক্তাক্ষর বর্জিত শিশুপাঠ্য কাব্য ও সেই বছরেই শিক্ষানবীশের পদ্য নামে আর একটি কাব্যগ্রন্থ রচনা করেন। সারদাচরণ মিত্রের সহযোগিতায় সম্পাদনা করেছিলেন প্রাচীন কাব্যসংগ্রহ নামে একটি কাব্যসংকলনও। ১৮৭৪ থেকে ১৮৭৭ সালের মধ্যে খণ্ডে খণ্ডে প্রকাশিত এই কাব্যে স্থান পায় বিদ্যাপতি, চণ্ডীদাস, গোবিন্দদাস, মুকুন্দ চক্রবর্তী প্রমুখ মধ্যযুগীয় কবিদের কাব্যকৃতি।\r\n\r\nঅবশ্য কবিতা অপেক্ষা গদ্যরচনাতেই তিনি অধিক খ্যাতিলাভ করেন। ১৮৭৪ সালে রচিত সমাজ সমালোচনা এবং মৃত্যুর পরে ১৯২৩ সালে প্রকাশিত রূপক ও রহস্য তার গদ্য রচনার শ্রেষ্ঠ নিদর্শন। ১৯০৪ সালে বঙ্গভাষার লেখক গ্রন্থের পিতাপুত্র প্রবন্ধটি তার একটি মূল্যবান সাহিত্যকীর্তি। এই গ্রন্থে পিতা গঙ্গাচরণ সরকার ও নিজের সাহিত্যজীবনের কথা লিখেছিলেন তিনি। অন্যান্য রচিত গ্রন্থগুলির মধ্যে কবি হেমচন্দ্র, সংক্ষিপ্ত রামায়ণ, মোতিকুমারী, মহাপূজা, সনাতনী ইত্যাদি উল্লেখযোগ্য।\r\n\r\nরাজনৈতিক ক্ষেত্রে রেন্ট বিল ও এজ অব কনসেন্ট বিল (অ্যাক্ট ১০)-এর বিরুদ্ধে প্রবল ব্রিটিশ-বিদ্বেষী ও স্বদেশী দ্রব্য প্রচলনের সমর্থক হলেও ছিলেন কংগ্রেসি মধ্যপন্থী। বঙ্গীয় সাহিত্য সম্মিলনের ষষ্ঠ অধিবেশনের মূল সভাপতি, বঙ্গীয় সাহিত্য পরিষদ-এর সহ-সভাপতি ও ভারতসভার প্রথম যুগ্ম সহ-সম্পাদকের পদ আবৃত করেন অক্ষয়চন্দ্র। ভারতীয় জাতীয় কংগ্রেসের ১৮৮৬ অধিবেশনে উৎসাহী কর্মীরূপে যোগ দিয়েছিলেন। রায়তদের স্বার্থরক্ষায়ও সচেষ্ট ছিলেন। সাহিত্যক্ষেত্রে বঙ্কিমচন্দ্রের ভাবশিষ্য হলেও বঙ্কিমি দৃঢ়তা ও ঋজুতা তার লেখায় অনুপস্থিত ছিল।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-25 04:11:43',	'2023-07-25 04:11:43'),
(14,	'অক্ষয়চন্দ্র সরকার',	'অক্ষয়চন্দ্র সরকার',	'অক্ষয়চন্দ্র সরকার (জন্ম: ১১ ডিসেম্বর ১৮৪৬ – মৃত্যু: ২ অক্টোবর ১৯১৭) ছিলেন ঊনবিংশ শতাব্দীর বিশিষ্ট বাঙালি কবি, প্রাবন্ধিক ও সাহিত্য সমালোচক। রায়বাহাদুরের পুত্র হয়েও ব্রিটিশ-বিরোধী আন্দোলনের প্রবল সমর্থক অক্ষয়চন্দ্র দেশীয় শিল্পের পুনরুজ্জীবন ও স্বায়ত্তশাসনের উপযোগী শিক্ষাব্যবস্থা প্রবর্তনের পক্ষপাতী ছিলেন।\r\nঅক্ষয়চন্দ্রে জন্ম বর্তমান হুগলি জেলার চুঁচুড়ার কদমতলায়। পিতা ছিলেন সেযুগের বিশিষ্ট কবি ও সাহিত্যিক রায়বাহাদুর গঙ্গাচরণ সরকার। শিক্ষা প্রথমে হুগলি কলেজিয়েট স্কুল ও পরে কলকাতার প্রেসিডেন্সী কলেজে। কর্মজীবনে প্রথমে বহরমপুরে ও পরে চুঁচুড়ায় ওকালতি করতেন। প্রথম যৌবনে বঙ্কিমচন্দ্র চট্টোপাধ্যায় সম্পাদিত বঙ্গদর্শন পত্রিকায় লেখালেখি শুরু করেন। ১৮৭২ সালে বঙ্গদর্শনের প্রথম সংখ্যায় তার উদ্দীপনা নামে একটি প্রবন্ধ প্রকাশিত হয়।\r\nঅক্ষয়চন্দ্র ১৮৭২ সালে মাসিক নবজীবন ও ১৮৭৩ সালে সাপ্তাহিক সাধারণী নামে দুটি পত্রিকা প্রকাশ করেন। নবজীবন চলেছিল ১৮৭৮ সাল অবধি। হেমচন্দ্র বন্দ্যোপাধ্যায়, নবীনচন্দ্র সেন, রবীন্দ্রনাথ ঠাকুর ও রামেন্দ্রসুন্দর ত্রিবেদীর মতো লেখকেরা এই জনপ্রিয় চিন্তাশীল পত্রিকাটিতে লেখালেখি করেন। রামেন্দ্রসুন্দরের প্রথম বাংলা রচনা এই পত্রিকাতেই প্রকাশিত হয়। চুঁচুড়া থেকে প্রকাশিত সাধারণী পত্রিকাটির উদ্দেশ্য ছিল রাজনৈতিক আলোচনা ও হিন্দুসমাজের মূল দৃঢ় করা। বঙ্কিমচন্দ্র চট্টোপাধ্যায়, ইন্দ্রনাথ বন্দ্যোপাধ্যায়, বঙ্গবাসী পত্রিকার যোগেন্দ্রচন্দ্র বসু প্রমুখ প্রথম সারির সাহিত্যিকের রচনা এই পত্রিকায় প্রকাশিত হত।\r\n\r\n১৮৭৪ সালে গোচারণের মাঠ নামে একটি যুক্তাক্ষর বর্জিত শিশুপাঠ্য কাব্য ও সেই বছরেই শিক্ষানবীশের পদ্য নামে আর একটি কাব্যগ্রন্থ রচনা করেন। সারদাচরণ মিত্রের সহযোগিতায় সম্পাদনা করেছিলেন প্রাচীন কাব্যসংগ্রহ নামে একটি কাব্যসংকলনও। ১৮৭৪ থেকে ১৮৭৭ সালের মধ্যে খণ্ডে খণ্ডে প্রকাশিত এই কাব্যে স্থান পায় বিদ্যাপতি, চণ্ডীদাস, গোবিন্দদাস, মুকুন্দ চক্রবর্তী প্রমুখ মধ্যযুগীয় কবিদের কাব্যকৃতি।\r\n\r\nঅবশ্য কবিতা অপেক্ষা গদ্যরচনাতেই তিনি অধিক খ্যাতিলাভ করেন। ১৮৭৪ সালে রচিত সমাজ সমালোচনা এবং মৃত্যুর পরে ১৯২৩ সালে প্রকাশিত রূপক ও রহস্য তার গদ্য রচনার শ্রেষ্ঠ নিদর্শন। ১৯০৪ সালে বঙ্গভাষার লেখক গ্রন্থের পিতাপুত্র প্রবন্ধটি তার একটি মূল্যবান সাহিত্যকীর্তি। এই গ্রন্থে পিতা গঙ্গাচরণ সরকার ও নিজের সাহিত্যজীবনের কথা লিখেছিলেন তিনি। অন্যান্য রচিত গ্রন্থগুলির মধ্যে কবি হেমচন্দ্র, সংক্ষিপ্ত রামায়ণ, মোতিকুমারী, মহাপূজা, সনাতনী ইত্যাদি উল্লেখযোগ্য।\r\n\r\nরাজনৈতিক ক্ষেত্রে রেন্ট বিল ও এজ অব কনসেন্ট বিল (অ্যাক্ট ১০)-এর বিরুদ্ধে প্রবল ব্রিটিশ-বিদ্বেষী ও স্বদেশী দ্রব্য প্রচলনের সমর্থক হলেও ছিলেন কংগ্রেসি মধ্যপন্থী। বঙ্গীয় সাহিত্য সম্মিলনের ষষ্ঠ অধিবেশনের মূল সভাপতি, বঙ্গীয় সাহিত্য পরিষদ-এর সহ-সভাপতি ও ভারতসভার প্রথম যুগ্ম সহ-সম্পাদকের পদ আবৃত করেন অক্ষয়চন্দ্র। ভারতীয় জাতীয় কংগ্রেসের ১৮৮৬ অধিবেশনে উৎসাহী কর্মীরূপে যোগ দিয়েছিলেন। রায়তদের স্বার্থরক্ষায়ও সচেষ্ট ছিলেন। সাহিত্যক্ষেত্রে বঙ্কিমচন্দ্রের ভাবশিষ্য হলেও বঙ্কিমি দৃঢ়তা ও ঋজুতা তার লেখায় অনুপস্থিত ছিল।',	'Poet',	'',	'',	'',	NULL,	'1',	'2023-07-25 04:26:18',	'2023-07-25 04:26:08',	'2023-07-25 04:26:18'),
(15,	'গিরিশচন্দ্র ঘোষ',	'গিরিশচন্দ্র ঘোষ',	'গিরিশচন্দ্র ঘোষ (২৮ ফেব্রুয়ারি, ১৮৪৪ - ৮ ফেব্রুয়ারি, ১৯১২) ছিলেন একজন বিশিষ্ট বাঙালি সংগীতস্রষ্টা, কবি, নাট্যকার, ঔপন্যাসিক, নাট্যপরিচালক ও নট। বাংলা থিয়েটারের স্বর্ণযুগ মূলত তারই অবদান।\r\n১৮৬৭ সালে শর্মিষ্ঠা নাটকের গীতিকার হিসাবে নাট্যজগৎতে প্রথম যুক্ত। দু\'বছর পরে সধবার একাদশিতে অভিনয় করে বেশ সুনাম অর্জন করে ছিলেন। কলকাতায় ন্যাশানাল থিয়েটার নামে তার একটি নাট্য কোম্পানি ছিল। ১৮৮৪ সালের ২০ সেপ্টেম্বর নটী বিনোদিনীকে নিয়ে তিনি স্টার থিয়েটার, কলকাতা চৈতন্যলীলা নাটকটি মঞ্চস্থ করেন। \r\nগিরিশচন্দ্র প্রায় ১০০ টি নাটক রচনা করেন। এর মধ্যে উল্লেখযোগ্য নাটক প্রায় ৭৫ টি।\r\n১৮৭৭ সালে মেঘনাদবধ কাব্যে রামচন্দ্র ও মেঘনাদ উভয় ক্ষেত্রে অভিনয় জন্য সাধারণী পত্রিকার সম্পাদক অক্ষয়চন্দ্র সরকার তাকে \'বঙ্গের গ্যারিক\' আখ্যায় ভূষিত করেন।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-25 05:16:01',	'2023-07-25 05:16:01'),
(16,	'চিত্তরঞ্জন দাশ',	'চিত্তরঞ্জন দাশ',	'দেশবন্ধু চিত্তরঞ্জন দাশ (৫ নভেম্বর ১৮৭০ - ১৬ জুন ১৯২৫) হলেন একজন বাঙালি আইনজীবী, রাজনীতিবিদ, স্বাধীনতা সংগ্রামী, কবি ও লেখক। তিনি স্বরাজ্য পার্টি-র প্রতিষ্ঠাতা। তার সময়ের অন্যতম বৃহৎ অঙ্কের আয় অর্জনকারী উকিল হওয়া সত্ত্বেও তিনি তার সম্পদ অকাতরে সাহায্যপ্রার্থীদের কাছে বিলিয়ে দিয়ে বাংলার ইতিহাসে দানবীর হিসাবে সুপরিচিত হয়ে আছেন। তিনি \"দেশবন্ধু\" নামেতে জগৎ বিখ্যাত হয়ে আছেন।\r\n১৮৯৪ সালে কলকাতা হাইকোর্টে ব্যারিস্টার হিসেবে নিজের নাম তালিকাভুক্ত করেন। ১৯০৮ সালে অরবিন্দ ঘোষের বিচার তাকে পেশাগত মঞ্চের সম্মুখ সারিতে নিয়ে আসে। তিনি এত সুনিপুণ দক্ষতায় মামলাটিতে বিবাদী পক্ষ সমর্থন করেন যে অরবিন্দকে শেষ পর্যন্ত বেকসুর খালাস দেয়া হয়। তিনি ঢাকা ষড়যন্ত্র মামলায় (১৯১০-১১) বিবাদী পক্ষের কৌশলী ছিলেন।\r\n১৯২৫ সালের ১৬ই জুন চিত্তরঞ্জন দাশ মৃত্যুবরণ করেন।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-25 05:50:51',	'2023-07-25 05:50:51'),
(17,	'মানিক বন্দ্যোপাধ্যায়',	'মানিক বন্দ্যোপাধ্যায়',	'মানিক বন্দ্যোপাধ্যায় (১৯ মে, ১৯০৮ - ৩ ডিসেম্বর, ১৯৫৬) ছিলেন একজন ভারতীয় বাঙালি কথাসাহিত্যিক। তার প্রকৃত নাম প্রবোধকুমার বন্দ্যোপাধ্যায়।\r\nফ্রয়েডীয় মনঃসমীক্ষণ ও মার্কসীয় শ্রেণীসংগ্রাম তত্ত্ব দ্বারা গভীরভাবে প্রভাবিত হয়েছিলেন যা তার রচনায় ফুটে উঠেছে। জীবনের অতি ক্ষুদ্র পরিসরে তিনি রচনা করেন চল্লিশটি উপন্যাস ও তিনশত ছোটোগল্প। তার রচিত পুতুলনাচের ইতিকথা, দিবারাত্রির কাব্য, পদ্মা নদীর মাঝি ইত্যাদি উপন্যাস ও অতসীমামী, প্রাগৈতিহাসিক, ছোটবকুলপুরের যাত্রী ইত্যাদি গল্পসংকলন বাংলা সাহিত্যের অন্যতম শ্রেষ্ঠ সম্পদ বলে বিবেচিত হয়।\r\n১৯৩৫ খ্রিষ্টাব্দ থেকে লেখক মৃগী রোগে আক্রান্ত ছিলেন যা পরবর্তী কালে জটিল অবস্থায় গমন করে। জীবনের শেষদিকে তীব্র আর্থিক কষ্টে ভুগেছেন তিনি। দীর্ঘদিন রোগভোগের পর ৩রা ডিসেম্বর ১৯৫৬ খ্রিষ্টাব্দে তার মৃত্যু ঘটে।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-25 05:54:51',	'2023-07-25 05:55:17'),
(18,	'রজনীকান্ত সেন',	'রজনীকান্ত সেন',	'রজনীকান্ত সেন (২৬ জুলাই, ১৮৬৫ - ১৩ সেপ্টেম্বর, ১৯১০) প্রখ্যাত কবি, গীতিকার এবং সুরকার হিসেবে বাঙালি শিক্ষা-সংস্কৃতিতে চিরস্মরণীয় হয়ে আছেন। তিনি \"কান্তকবি\" নামেও পরিচিত। দ্বিজেন্দ্রলাল রায়ের সমসাময়িক এই গীতিকারের গানগুলো খুবই জনপ্রিয়। ঈশ্বরের আরাধনায় ভক্তিমূলক ও দেশের প্রতি গভীর মমত্ববোধ বা স্বদেশ প্রেমই তাঁর গানের প্রধান বৈশিষ্ট্য ও উপজীব্য বিষয়। বঙ্গভঙ্গ আদেশ রদের জন্য ১৯০৫ খ্রিস্টাব্দে যে স্বদেশী আন্দোলনের সূত্রপাত হয় সেই সময় কান্ত কবি রচনা করলেন বিখ্যাত গান \'মায়ের দেওয়া মোটা কাপড় মাথায় তুলে নেরে ভাই\' এই গান বিপ্লবীদের অনুপ্রেরণা দিত। অবশ্য তিনি অনেক হাসির গান লিখেছেন। তার বিখ্যাত দুটি কাব্যগ্রন্থ \'বাণী\' এবং \'কল্যাণী\'। অনেক গানে তিনি সুরও দিয়েছেন।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 05:21:02',	'2023-07-26 05:21:02'),
(19,	'বিভূতিভূষণ বন্দ্যোপাধ্যায়',	'বিভূতিভূষণ',	'বিভূতিভূষণ বন্দ্যোপাধ্যায় (১২ই সেপ্টেম্বর, ১৮৯৪ – ১লা নভেম্বর, ১৯৫০[১]) ছিলেন একজন জনপ্রিয় ভারতীয় বাঙালি সাহিত্যিক। তিনি মূলত উপন্যাস ও ছোটগল্প লিখে খ্যাতি অর্জন করেন। পথের পাঁচালী ও অপরাজিত তাঁর সবচেয়ে বেশি পরিচিত উপন্যাস। অন্যান্য উপন্যাসের মধ্যে আরণ্যক, চাঁদের পাহাড়,আদর্শ হিন্দু হোটেল, ইছামতী ও অশনি সংকেত বিশেষভাবে উল্লেখযোগ্য। উপন্যাসের পাশাপাশি বিভূতিভূষণ প্রায় ২০টি গল্পগ্রন্থ, কয়েকটি কিশোরপাঠ্য উপন্যাস ও ভ্রমণকাহিনি এবং দিনলিপিও রচনা করেন। বিভূতিভূষণের পথের পাঁচালী উপন্যাস অবলম্বনে সত্যজিৎ রায় পরিচালিত চলচ্চিত্রটি আন্তর্জাতিক খ্যাতিসম্পন্ন। ১৯৫১ সালে ইছামতী উপন্যাসের জন্য বিভূতিভূষণ পশ্চিমবঙ্গের সর্বোচ্চ সাহিত্য পুরস্কার রবীন্দ্র পুরস্কার (মরণোত্তর) লাভ করেন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 05:30:53',	'2023-07-26 05:30:53'),
(20,	'সুকুমার রায়',	'সুকুমার রায়',	'সুকুমার রায় (৩০শে অক্টোবর ১৮৮৭ - ১ই সেপ্টেম্বর ১৯২৩) ছিলেন একজন বাঙালি শিশুসাহিত্যিক ও ভারতীয় সাহিত্যে \"ননসেন্স ছড়া\"র প্রবর্তক। তিনি একাধারে লেখক, ছড়াকার, শিশুসাহিত্যিক, রম্যরচনাকার, প্রাবন্ধিক, নাট্যকার ও সম্পাদক। তিনি ছিলেন জনপ্রিয় শিশুসাহিত্যিক উপেন্দ্রকিশোর রায়চৌধুরীর সন্তান এবং তাঁর পুত্র খ্যাতিমান ভারতীয় চলচ্চিত্রকার সত্যজিৎ রায়। তাঁর লেখা কবিতার বই আবোল তাবোল, গল্প হ-য-ব-র-ল, গল্প সংকলন পাগলা দাশু এবং নাটক চলচ্চিত্তচঞ্চরী বিশ্বসাহিত্যে সর্বযুগের সেরা \"ননসেন্স\" ধরনের ব্যঙ্গাত্মক শিশুসাহিত্যের অন্যতম বলে মনে করা হয়, কেবল অ্যালিস ইন ওয়ান্ডারল্যান্ড ইত্যাদি কয়েকটি মুষ্টিমেয় ধ্রুপদী সাহিত্যই যাদের সমকক্ষ। মৃত্যুর শত বছর পরেও তিনি বাংলা সাহিত্যের সবচেয়ে জনপ্রিয়তম শিশুসাহিত্যিকদের মধ্যে অন্যতম একজন।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 05:59:13',	'2023-07-26 05:59:13'),
(21,	'রামনাথ বিশ্বাস',	'রামনাথ বিশ্বাস',	'রামনাথ বিশ্বাস (১৩ জানুয়ারি ১৮৯৪ - ১ নভেম্বর ১৯৫৫) একজন ভারতীয় বিপ্লবী, সৈনিক, ভূপর্যটক ও ভ্রমণকাহিনী লেখক।তিনি ১৯৩৬ ও ১৯৩৭ সালে সাইকেলে চড়ে বিশ্বভ্রমণ করেছিলেন। কলকাতায় বসবাসকালে রামনাথের ভ্রমণকাহিনী আনন্দবাজার পত্রিকায় ধারাবাহিকভাবে প্রকাশিত হত। পরে তা গ্রন্থ আকারে প্রকাশিত হয়। তার রচিত গ্রন্থের সংখ্যা তিরিশের উপর। এগুলো মধ্যে রয়েছে:\r\n\r\nঅন্ধকারের আফ্রিকা\r\nআজকের আমেরিকা\r\nযুযুৎসু জাপান\r\nতরুণ তুর্কী\r\nদুরন্ত দক্ষিণ আফ্রিকা\r\nনিগ্রো জাতির নতুন জীবন\r\nপ্রশান্ত মহাসাগরে অশান্তি\r\nবেদুইনের দেশে\r\nভবঘুরের বিশ্বভ্রমণ\r\nভিয়েতনামের বিদ্রোহী বীর\r\nমাউ মাউএর দেশে\r\nমালয়েশিয়া ভ্রমণ\r\nলাল চীন\r\nবিদ্রোহী বলকান\r\nসর্ব্ব-স্বাধীন শ্যাম\r\nহলিউডের আত্মকথা\r\nট্যুর রাউন্ড দ্য ওয়ার্ল্ড উইদাউট মানি (Tour Round The World Without Money)\r\nনাবিক\r\nসাগর পারের ওপারে\r\nআগুনের আলো\r\nমুক্ত মহাচীন\r\nদ্বিচক্রে কোরিয়া\r\nপৃথিবীর পথে\r\nফ্রান্সে ভারতীয় ভূপর্যটক\r\nমরণ বিজয়ী চীন\r\nআমেরিকার নিগ্রো\r\nআফগানিস্থান',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 06:06:09',	'2023-07-26 06:06:09'),
(22,	'সুভাষচন্দ্র বসু',	'সুভাষচন্দ্র বসু',	'সুভাষচন্দ্র বসু  (২৩ জানুয়ারি ১৮৯৭ - ১৮ আগস্ট ১৯৪৫) ভারতের স্বাধীনতা সংগ্রামের এক চিরস্মরণীয় কিংবদন্তি নেতা। ভারতের স্বাধীনতা সংগ্রামের ইতিহাসে তিনি হলেন এক উজ্জ্বল ও মহান চরিত্র যিনি এই সংগ্রামে নিজের সমগ্র জীবন উৎসর্গ করেছিলেন। তিনি নেতাজি নামে সমধিক পরিচিত। সুভাষচন্দ্র পরপর দুইবার ভারতীয় জাতীয় কংগ্রেসের সভাপতি নির্বাচিত হয়েছিলেন। কিন্তু গান্ধীর সঙ্গে আদর্শগত সংঘাত, কংগ্রেসের বৈদেশিক ও অভ্যন্তরীণ নীতির প্রকাশ্য সমালোচনা এবং বিরুদ্ধ-মত প্রকাশ করার জন্য তাকে পদত্যাগ করতে হয়। রবীন্দ্রনাথ ঠাকুর সুভাষচন্দ্রকে \' দেশনায়ক \' আখ্যা দিয়ে \'তাসের দেশ\' নৃত্যনাট্যটি তাকে উৎসর্গ করেন। উৎসর্গপত্রে লেখেন: \"স্বদেশের চিত্তে নূতন প্রাণ সঞ্চার করবার পূণ্যব্রত তুমি গ্রহণ করেছ, সেই কথা স্মরণ ক’রে তোমার নামে ‘তাসের দেশ’ নাটিকা উৎসর্গ করলুম।\"\r\nঐতিহাসিকদের মতে, ১৯৪৫ সালের ১৮ আগস্ট, সুভাষচন্দ্র বসুকে বহনকারী জাপানি বিমান, জাপান শাসিত ফোরমোসায় (বর্তমান তাইওয়ান) বিধ্বস্ত হওয়ার পর, আগুনে দগ্ধ হয়ে বসুর মৃত্যু ঘটে। তবে, তার অনেক অনুগামীই, বিশেষত বাংলায়, সে সময় ঘটনাটি অস্বীকার করে এবং এমনকি এখনো তার মৃত্যু সম্পর্কিত পরিস্থিতি ও তথ্য অবিশ্বাস করে।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 22:53:45',	'2023-07-26 22:53:45'),
(23,	'মাইকেল মধুসূদন দত্ত',	'মাইকেল মধুসূদন দত্ত',	'মাইকেল মধুসূদন দত্ত (২৫ জানুয়ারি ১৮২৪ – ২৯ জুন ১৮৭৩) ঊনবিংশ শতাব্দীর অন্যতম শ্রেষ্ঠ বাঙালি কবি এবং নাট্যকার ও প্রহসন রচয়িতা। তাকে বাংলার নবজাগরণ সাহিত্যের অন্যতম পুরোধা ব্যক্তিত্ব গণ্য করা হয়। ঐতিহ্যের অনুবর্তিতা অমান্য করে নব্যরীতি প্রবর্তনের কারণে তাকে আধুনিক বাংলা সাহিত্যের প্রথম বিদ্রোহী কবি হিসেবেও অভিহিত করা হয়।\r\n\r\nব্রিটিশ ভারতের(বর্তমান বাংলাদেশের) যশোর জেলার এক সম্ভ্রান্ত কায়স্থ বংশে জন্ম হলেও মধুসূদন যৌবনে খ্রিষ্টধর্ম গ্রহণ করে মাইকেল মধুসূদন নাম গ্রহণ করেন এবং পাশ্চাত্য সাহিত্যের দুর্নিবার আকর্ষণবশত ইংরেজি ভাষায় সাহিত্য রচনায় মনোনিবেশ করেন। জীবনের দ্বিতীয় পর্বে মধুসূদন নিজ মাতৃভাষার প্রতি মনোযোগ দেন। এ পর্বে তিনি বাংলায় নাটক, প্রহসন ও কাব্যরচনা করেন। মাইকেল মধুসূদন বাংলা ভাষায় সনেট ও অমিত্রাক্ষর ছন্দের প্রবর্তক। তার সর্বশ্রেষ্ঠ কীর্তি অমিত্রাক্ষর ছন্দে রামায়ণের উপাখ্যান অবলম্বনে রচিত মেঘনাদবধ কাব্য নামক মহাকাব্য।\r\n\r\nমধুসূদনের ব্যক্তিগত জীবন ছিল নাটকীয় এবং বেদনাঘন। মাত্র ৪৯ বছর বয়সে কলকাতায় এই মহাকবির মৃত্যু হয় এক শোকাবহ অবস্থার মধ্য দিয়ে।\r\n\r\nতার সর্বশ্রেষ্ঠ কীর্তি অমিত্রাক্ষর ছন্দে রামায়ণের উপাখ্যান অবলম্বনে রচিত মেঘনাদবধ কাব্য নামক মহাকাব্য। তার অন্যান্য উল্লেখযোগ্য গ্রন্থাবলি হলো দ্য ক্যাপটিভ লেডি, শর্মিষ্ঠা, কৃষ্ণকুমারী (নাটক), পদ্মাবতী (নাটক), বুড়ো শালিকের ঘাড়ে রোঁ, একেই কি বলে সভ্যতা, তিলোত্তমাসম্ভব কাব্য, বীরাঙ্গনা কাব্য, ব্রজাঙ্গনা কাব্য, চতুর্দশপদী কবিতাবলী, হেকটর বধ ইত্যাদি।',	'Poet',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 22:57:14',	'2023-07-26 22:57:14'),
(24,	'স্বামী বিবেকানন্দ',	'স্বামী বিবেকানন্দ',	'স্বামী বিবেকানন্দ (১২ জানুয়ারি ১৮৬৩ – ৪ জুলাই ১৯০২); জন্মনাম নরেন্দ্রনাথ দত্ত ছিলেন একজন হিন্দু সন্ন্যাসী, দার্শনিক, লেখক, সংগীতজ্ঞ এবং ঊনবিংশ শতাব্দীর ভারতীয় অতীন্দ্রিয়বাদী রামকৃষ্ণ পরমহংসের প্রধান শিষ্য। তার পূর্বাশ্রমের নাম ছিল নরেন্দ্রনাথ দত্ত। তিনি মার্কিন যুক্তরাষ্ট্র ও ইউরোপে হিন্দুধর্ম তথা ভারতীয় বেদান্ত ও যোগ দর্শনের প্রচারে প্রধান ভূমিকা গ্রহণ করেছিলেন। অনেকে ঊনবিংশ শতাব্দীর শেষার্ধে বিভিন্ন ধর্মমতের মধ্যে পারস্পরিক সুসম্পর্ক স্থাপন এবং হিন্দুধর্মকে বিশ্বের অন্যতম প্রধান ধর্ম হিসেবে প্রচার করার কৃতিত্ব বিবেকানন্দকে দিয়ে থাকেন। ভারতে হিন্দু পুনর্জাগরণের তিনি ছিলেন অন্যতম পুরোধা ব্যক্তিত্ব। সেই সঙ্গে ব্রিটিশ ভারতে তিনি ভারতীয় জাতীয়তাবাদের ধারণাটি প্রবর্তন করেন। বিবেকানন্দ রামকৃষ্ণ মঠ ও রামকৃষ্ণ মিশন প্রতিষ্ঠা করেন।\r\nতার রচিত গ্রন্থগুলির মধ্যে উল্লেখযোগ্য চিকাগো বক্তৃতা, কর্মযোগ, রাজযোগ, জ্ঞানযোগ, হার্ভার্ড বিশ্ববিদ্যালয়ে বেদান্ত, ভারতে বিবেকানন্দ, ভাববার কথা, পরিব্রাজক, প্রাচ্য ও পাশ্চাত্য, বর্তমান ভারত, বীরবাণী (কবিতা-সংকলন), মদীয় আচার্যদেব ইত্যাদি। বিবেকানন্দ ছিলেন সংগীতজ্ঞ ও গায়ক। তার রচিত দুটি বিখ্যাত গান হল \"খণ্ডন-ভব-বন্ধন\" (শ্রীরামকৃষ্ণ আরাত্রিক ভজন) ও \"নাহি সূর্য নাহি জ্যোতি\"। এছাড়া \"নাচুক তাহাতে শ্যামা\", \"৪ জুলাইয়ের প্রতি\", \"সন্ন্যাসীর গীতি\" ও \"সখার প্রতি\" তার রচিত কয়েকটি বিখ্যাত কবিতা। \"সখার প্রতি\" কবিতার অন্তিম দুইটি চরণ– “বহুরূপে সম্মুখে তোমার ছাড়ি কোথা খুঁজিছ ঈশ্বর? / জীবে প্রেম করে যেই জন, সেই জন সেবিছে ঈশ্বর।\" – বিবেকানন্দের সর্বাধিক উদ্ধৃত একটি উক্তি।\r\nস্বামী বিবেকানন্দ কলকাতার এক উচ্চবিত্ত হিন্দু বাঙালি পরিবারে জন্মগ্রহণ করেছিলেন। ছোটোবেলা থেকেই আধ্যাত্মিকতার প্রতি তিনি আকর্ষিত হতেন। তার গুরু রামকৃষ্ণ দেবের কাছ থেকে তিনি শেখেন, সকল জীবই ঈশ্বরের প্রতিভূ; তাই মানুষের সেবা করলেই ঈশ্বরের সেবা করা হয়। রামকৃষ্ণের মৃত্যুর পর বিবেকানন্দ ভারতীয় উপমহাদেশ ভালোভাবে ঘুরে দেখেন এবং ব্রিটিশ ভারতের আর্থ-সামাজিক অবস্থা সম্পর্কে প্রত্যক্ষ জ্ঞান অর্জন করেন। পরে তিনি মার্কিন যুক্তরাষ্ট্রে গিয়ে ১৮৯৩ খ্রিষ্টাব্দের বিশ্ব ধর্ম মহাসভায় ভারত ও হিন্দুধর্মের প্রতিনিধিত্ব করেন। মার্কিন যুক্তরাষ্ট্র, ইংল্যান্ড ও ইউরোপে তিনি হিন্দু দর্শনের বিভিন্ন দিক সম্পর্কে অসংখ্য সাধারণ ও ঘরোয়া বক্তৃতা দিয়েছিলেন এবং ক্লাস নিয়েছিলেন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 23:02:22',	'2023-07-26 23:02:22'),
(25,	'সুরেন্দ্রনাথ বন্দ্যোপাধ্যায়',	'সুরেন্দ্রনাথ',	'স্যার সুরেন্দ্রনাথ বন্দ্যোপাধ্যায় (১০ নভেম্বর, ১৮৪৮ – ৬ আগস্ট, ১৯২৫) ব্রিটিশ ভারতের স্বাধীনতা আন্দোলনের প্রথম যুগের একজন বিশিষ্ট নেতা। তিনি ছিলেন ঊনবিংশ শতাব্দীর রাজনৈতিক সংগঠন ন্যাশনাল কনফারেন্সের প্রতিষ্ঠাতা। পরে এ দলটিকে নিয়ে তিনি ভারতীয় জাতীয় কংগ্রেসে যোগ দেন। তাঁকে রাষ্ট্রগুরু সম্মানে ভূষিত করা হয়েছিল।\r\nকলকাতা বিশ্ববিদ্যালয় থেকে স্নাতক ডিগ্রী অর্জনের পর সুরেন্দ্রনাথ ব্যানার্জী ইংল্যান্ডে চলে যান এবং ইন্ডিয়ান সিভিল সার্ভিস (আইসিএস) পরীক্ষা পাশ করেন। অতঃপর ১৮৭১ সালে তিনি সিভিল সার্ভিসের কর্মজীবনে সহকারী ম্যাজিস্ট্রেট হিসেবে সিলেটে আসেন। তিনি তার নির্ধারিত দায়িত্ব সঠিকভাবে চালাতে পারেননি ও অগ্রসর হতে চান না - এ অজুহাতে তাকে চাকরি থেকে বরখাস্ত করা হয়। জাতীয় নেতৃত্বে জোরালোভাবে অংশগ্রহণ করার লক্ষ্যে তিনি পুনরায় ইংল্যান্ডে গমন করেন। তিনি যেমন ছিলেন একজন স্বভাবজাত লেখক তদ্রূপ বাগ্মী হিসেবেও তিনি ছিলেন বিশেষভাবে পরিচিত ।\r\n\r\nজুন, ১৮৭৫ সালে মাতৃভূমি ভারতে ফিরে আসেন এবং শিক্ষকতার মহান পেশায় নিজেকে মনোনিবেশ ঘটান। ইংরেজির প্রফেসর হিসেবে প্রথমে মেট্রোপলিটন ইনস্টিটিউশন এবং পরে ফ্রী চার্চ কলেজে নিয়োজিত ছিলেন। সর্বশেষে রিপন কলেজে যোগ দেন। পরবর্তীকালে এই রিপন কলেজই তার নামে নামকরণ করা হয় সুরেন্দ্রনাথ কলেজ হিসেবে।\r\n১৯২১ সালে তিনি নাইট উপাধি লাভ করেন এবং বাংলায় তৎকালীন সরকারের মন্ত্রী হিসেবে ১৯২১ থেকে ১৯২৪ সাল পর্যন্ত দেশের সেবায় মনোনিবেশ করেন।\r\n\r\n৬ই আগস্ট, ১৯২৫; স্যার সুরেন্দ্রনাথ বন্দ্যোপাধ্যায় ৭৭ বৎসর বয়সে প্রয়াত হন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-26 23:13:17',	'2023-07-26 23:13:17'),
(26,	'প্যারীচাঁদ মিত্র',	'প্যারীচাঁদ মিত্র',	'প্যারীচাঁদ মিত্র (২২শে জুলাই, ১৮১৪- ২৩শে নভেম্বর, ১৮৮৩) বাংলা সাহিত্যের প্রথম ঔপন্যাসিক; ছদ্মনাম টেকচাঁদ ঠাকুর।\r\nআলালের ঘরের দুলাল (তার শ্রেষ্ঠ এবং বাংলা সাহিত্যের প্রথম উপন্যাস)। ১৮৫৮ খ্রি. প্রকাশিত এই উপন্যাসটির অন্যতম প্রধান চরিত্র ঠকচাচা । উল্লেখ্য যে এখানে তিনি যে কথ্য ভাষা ব্যবহার করেছিলেন তা আলালী ভাষা নামে পরিচিতি লাভ করেছে। এই গ্রন্থটি ইংরেজিতেও অনুবাদ করা হয়েছিল The spoiled child নামে।\r\nমদ খাওয়া বড় দায়, জাত থাকার কি উপায় (১৮৫৯) তার এ গ্রন্থে উদ্ভট কল্পনা লক্ষ করা যায়।\r\nঅভেদী(১৮৭১)\r\nআধ্যাত্মিকা(১৮৮০)\r\nThe Zemindar and Ryots. এই গ্রন্থটি তখনকার সময়ে অনেক আলোড়ন সৃষ্টি করেছিলো। কারণ এটি রচিত হয়েছিলো চিরস্থায়ী বন্দোবস্ত ব্যবস্থার বিরুদ্ধে।\r\nযৎকিঞ্চিৎ(১৮৬৫)\r\nরামারঞ্জিকা (১৮৬০)\r\nবামাতোষিণী(১৮৭১)\r\nগীতাঙ্কুর(১৮৬১)\r\nকৃষি পাঠ(১৮৬১)\r\nডেভিড হেয়ারের জীবনচরিত(১৭৭৮)\r\nএত দ্দেশীয় স্ত্রীলোক দিগে পূর্বাবস্থা(১৮৭৯)\r\n১৮৮৩ সালের ২৩শে নভেম্বর তিনি কলকাতায় মারা যান।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-27 00:11:13',	'2023-07-27 00:11:13'),
(27,	'নীলমণি বসাক',	'নীলমণি বসাক',	'নীলমণি বসাক (আনুমানিক ১৮০৮ – ৬-৮-১৮৬৪) কলিকাতা। রাজচন্দ্র। তন্তুবায়-বংশীয়, হেয়ার সাহেবের প্রিয়পাত্ৰ নীলমণি প্ৰথমে হুগলী কোর্টে একটি কেরানীর চাকরি দিয়ে শুরু করে ক্ৰমে বর্ধমানের কমিশনারের পার্সেনাল অ্যাসিস্ট্যান্ট হয়েছিলেন। সাহিত্যানুরাগী ছিলেন। রচিত গ্ৰন্থ: ‘পারস্য ইতিহাস’ (পদ্যে), ‘আরব্য উপন্যাস’ (১-৩ খণ্ড), ‘নরনারী’ (১৮৫২), ‘বত্রিশ সিংহাসন’, ‘রাজস্ব সম্পর্কীয় নিয়ম’, ‘পারস্য উপন্যাস’, ‘ভারতবর্ষের ইতিহাস’, ‘ইতিহাস-সার’ প্রভৃতি।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-27 00:32:18',	'2023-07-27 00:32:18'),
(28,	'প্রমথ চৌধুরী',	'প্রমথ চৌধুরী',	'প্রমথ চৌধুরী (৭ আগস্ট ১৮৬৮ — ২ সেপ্টেম্বর ১৯৪৬) বাংলা ভাষার অন্যতম সাহিত্যিক যিনি বিংশ শতাব্দীর প্রথম ভাগে সক্রিয় ছিলেন। তিনি ছিলেন একাধারে প্রাবন্ধিক, কবি ও ছোটগল্পকার। বীরবল ছদ্মনামও তিনি ব্যবহার করেছেন। তার পৈতৃক নিবাস বর্তমান বাংলাদেশের পাবনা জেলার অন্তর্গত চাটমোহর উপজেলার হরিপুর গ্রামে।\r\n\r\nতিনি বাংলা গদ্যে চলিত রীতির প্রবর্তক হিসাবে প্রসিদ্ধ। সবুজপত্র পত্রিকা সম্পাদনার মাধ্যমে বাংলা সাহিত্যে চলিতরীতি প্রবর্তন করেন।এছাড়া বাংলা সাহিত্যে প্রথম বিদ্রূপাত্মক প্রবন্ধ রচনা করেন। ছোটগল্প ও সনেট রচনাতেও হিসেবেও তার বিশিষ্ট অবদান রয়েছে। তিনি সবুজপত্র এবং বিশ্বভারতী পত্রিকা সম্পাদনা করেন।\r\n\r\nপ্রবন্ধ গ্রন্থ:\r\nতেল-নুন-লাকড়ী (১৯০৬)\r\nবীরবলের হালখাতা (১৯১৬)\r\nনানাকথা (১৯১৯)\r\nভাষার কথা:\r\nআমাদের শিক্ষা (১৯২০)\r\nরায়তের কথা (১৯১৯)\r\nনানাচর্চা (১৯৩২)\r\nপ্রবন্ধ সংগ্রহ (১৯৫২ ১ম খণ্ড ও ১৯৫৩ ২য় খণ্ড)\r\nগল্পগ্রন্থ:\r\nচার-ইয়ারী কথা (১৯১৬)\r\nআহুতি (১৯১৯)\r\nনীললোহিত (১৯৪১)\r\nঅনুকথা সপ্তক\r\nঘোষালে ত্রিকথা\r\nকাব্যগ্রন্থ\r\nসনেট পঞ্চাশৎ (১৯১৩)\r\nপদচারণ (১৯১৯)\r\nতার সাহিত্যিক ছদ্মনাম ছিল বীরবল। তার সম্পাদিত সবুজ পত্র বাংলা সাহিত্যে চলতি ভাষারীতি প্রবর্তনে আগ্রণী ভূমিকা পালন করে। তার প্রবর্তিত গদ্যরীতিতে “সবুজ পত্র” নামে বিখ্যাত সাহিত্যপত্র ইতিহাসে প্রতিষ্ঠিত হয়েছেন। তারই নেতৃত্বে বাংলা সাহিত্যে নতুন গদ্যধারা সূচিত হয়। তিনি বাংলা সাহিত্যে ইতালিয় রূপবন্ধের সনেট লিখেছেন। এছাড়াও তিনি বিশ্বভারতী পত্রিকার সম্পাদনা করেন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-27 00:42:35',	'2023-07-27 00:42:35'),
(29,	'দ্বিজেন্দ্রলাল রায়',	'দ্বিজেন্দ্রলাল রায়',	'দ্বিজেন্দ্রলাল রায় (১৯ জুলাই ১৮৬৩ - ১৭ মে ১৯১৩) ছিলেন একজন বিশিষ্ট বাঙালি কবি, নাট্যকার ও সংগীতস্রষ্টা। তিনি ডি. এল. রায় নামেও পরিচিত ছিলেন। তিনি প্রায় ৫০০ গান রচনা করেন। এই গানগুলি বাংলা সংগীত জগতে দ্বিজেন্দ্রগীতি নামে পরিচিত। তার বিখ্যাত গান \"ধনধান্য পুষ্প ভরা আমাদের এই বসুন্ধরা\", \"বঙ্গ আমার! জননী আমার! ধাত্রী আমার! আমার দেশ\" ইত্যাদি আজও সমান জনপ্রিয়। তিনি অনেকগুলি নাটক রচনা করেন। তার নাটকগুলি চার শ্রেণিতে বিন্যস্ত: প্রহসন, কাব্যনাট্য, ঐতিহাসিক নাটক ও সামাজিক নাটক। তার রচিত কাব্যগ্রন্থগুলির মধ্যে জীবদ্দশায় প্রকাশিত আর্যগাথা (১ম ও ২য় ভাগ) ও মন্দ্র বিখ্যাত। দ্বিজেন্দ্রলাল রায়ের বিখ্যাত নাটকগুলির মধ্যে উল্লেখযোগ্য একঘরে, কল্কি-অবতার, বিরহ, সীতা, তারাবাঈ, দুর্গাদাস, রাণা প্রতাপসিংহ, মেবার-পতন, নূরজাহান, সাজাহান, চন্দ্রগুপ্ত, সিংহল-বিজয় ইত্যাদি।\r\n\r\nকাব্যগ্রন্থ:\r\nআর্যগাথা, ১ম খণ্ড (১৮৮৪)\r\nThe Lyrics of India (ইং থাকাকালীন রচিত) (১৮৮৬ )\r\nআর্যগাথা, ২য় খণ্ড (১৮৮৪)\r\nআষাঢ়ে (১৮৯৯)\r\nহাসির গান (১৯০০)\r\nমন্দ্র (১৯০২)\r\nআলেখ্য (১৯০৭)\r\nত্রিবেণী (১৯১২)\r\nউল্লেখযোগ্য নাটক:\r\nপ্রহসন বা লঘু রসাশ্রয়ী নাটক\r\nএকঘরে (১৮৮৯)\r\nকল্কি অবতার (১৮৯৫)\r\nবিরহ (১৮৯৭)\r\nএ্যহস্পর্শ বা সুখী পরিবার (১৯০১)\r\nপ্রায়শ্চিত্ত (১৯০২)\r\nপুনর্জন্ম (১৯১১)\r\nআনন্দ-বিদায় (১৯১২)\r\nইতিহাসাশ্রয়ী নাটক:\r\nতারাবাঈ (১৯০৩)(প্রথম ঐতিহাসিক নাটক)\r\nরানা প্রতাপসিংহ (১৯০৫)\r\nদুর্গাদাস (১৯০৬)\r\nসোহরাব-রুস্তম (১৯০৮)\r\nনূরজাহান (১৯০৮)\r\nমেবার পতন (১৯০৮)\r\nসাজাহান (১৯০৯) (সর্বশ্রেষ্ঠ নাটক)[তথ্যসূত্র প্রয়োজন]\r\nচন্দ্রগুপ্ত (১৯১১)\r\nসিংহল বিজয় (১৯১৫)\r\nপৌরাণিক নাটক:\r\nপাষাণী (১৯০০)(প্রথম পৌরাণিক নাটক)\r\nসীতা (১৯০৮)(শ্রেষ্ঠ পৌরাণিক নাটক)\r\nভীষ্ম (১৯১৪)\r\nসামাজিক নাটক\r\nপরপারে (১৯১২)\r\nবঙ্গনারী (১৯১৬)\r\n\r\n১৯১৩ সালের ১৭ই মে তারিখে কলকাতায় দ্বিজেন্দ্রলালের জীবনাবসান ঘটে।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-27 01:02:52',	'2023-07-27 01:02:52'),
(30,	'দীনেশচন্দ্র সেন',	'দীনেশচন্দ্র সেন',	'দীনেশচন্দ্র সেন (রায়বাহাদুর) (৩ নভেম্বর,১৮৬৬- ২০ নভেম্বর,১৯৩৯) শিক্ষাবিদ, গবেষক, লোক-সাহিত্যবিশারদ, বাংলা সাহিত্যের ইতিহাসকার। তিনি কলকাতা বিশ্ববিদ্যালয়ের রামতনু লাহিড়ী রিসার্চ ফেলো এবং এর প্রতিষ্ঠাকালীন সদস্য ছিলেন।\r\n\r\nপ্রধান গ্রন্থসমূহ:\r\nবঙ্গভাষা ও সাহিত্য (১ম ও ২য় খণ্ড) (১৮৯৬)\r\nতিন বন্ধু (১৯০৪)\r\nরামায়ণী কথা (১৯০৪)\r\nবেহুলা (১৯০৭)\r\nসতী (১৯০৭)\r\nফুল্লরা (১৯০৭)\r\nজড় ভরত (১৯০৮)\r\nসুকথা (১৯১২)\r\nগৃহশ্রী (১৯১৬)\r\nনীলমানিক (১৯১৮)\r\nমুক্তা চুরি (১৯২০)\r\nসরল বাংলা সাহিত্য (১৯২২)\r\nবৈদিক ভারত (১৯২২)\r\nঘরের কথা ও যুগসাহিত্য (১৯২২)\r\nআলোকে আঁধারে (১৯২৫)\r\nচৌকির বিড়ম্বনা (১৯২৬)\r\nওপারের আলো (১৯২৭)\r\nপৌরাণিকী (১৯৩৪)\r\nবৃহৎ বঙ্গ (১ম ও ২য় খণ্ড) (১৯৩৫)\r\nআশুতোষ স্মৃতি কথা (১৯৩৬)\r\nশ্যামল ও কাজল (১৯৩৬)\r\nপদাবলী মাধুর্য্য (১৯৩৭)\r\nপুরাতনী (১৯৩৯)\r\nবাংলার পুরনারী (১৯৩৯)\r\nপ্রাচীন বাঙ্গলা সাহিত্যে মুসলমানের অবদান (১৯৪০)\r\nহিন্দু সমাজ ও বৈষ্ণব ধর্ম\r\nমৈমনসিংহ গীতিকা\r\nপূর্ব্ববঙ্গ গীতিকা\r\n\r\n১৯৩৯ সালের ২০ নভেম্বর কলকাতার বেহালায় তার মৃত্যু হয়।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-30 21:55:17',	'2023-07-30 21:55:17'),
(31,	'ঈশ্বরচন্দ্র বিদ্যাসাগর',	'ঈশ্বরচন্দ্র বিদ্যাসাগর',	'ঈশ্বরচন্দ্র বিদ্যাসাগর (ঈশ্বরচন্দ্র বন্দ্যোপাধ্যায়; ঈশ্বরচন্দ্র শর্মা নামেও স্বাক্ষর করতেন) (২৬ সেপ্টেম্বর ১৮২০ – ২৯ জুলাই ১৮৯১;১২ আশ্বিন, ১২২৭ – ১৩ শ্রাবণ ১২৯৭ বঙ্গাব্দ ) ঊনবিংশ শতকের একজন বিশিষ্ট বাঙালি শিক্ষাবিদ, সমাজ সংস্কারক ও গদ্যকার। সংস্কৃত ভাষা ও সাহিত্যে অগাধ পাণ্ডিত্যের জন্য সংস্কৃত কলেজ থেকে ১৮৩৯ সালে তিনি বিদ্যাসাগর উপাধি লাভ করেন। সংস্কৃত ছাড়াও বাংলা ও ইংরেজি ভাষায় বিশেষ ব্যুৎপত্তি ছিল তার। তিনিই প্রথম বাংলা লিপি সংস্কার করে তাকে যুক্তিবহ ও সহজপাঠ্য করে তোলেন। বাংলা গদ্যের প্রথম সার্থক রূপকার তিনিই। তাকে বাংলা গদ্যের প্রথম শিল্পী বলে অভিহিত করেছেন রবীন্দ্রনাথ ঠাকুর। তিনি রচনা করেছেন যুগান্তকারী শিশুপাঠ্য বর্ণপরিচয়-সহ একাধিক পাঠ্যপুস্তক, সংস্কৃত ব্যাকরণ গ্রন্থ। সংস্কৃত, হিন্দি ও ইংরেজি থেকে বাংলায় অনুবাদ সাহিত্য ও জ্ঞানবিজ্ঞান সংক্রান্ত বহু রচনা। নারীমুক্তির আন্দোলনেও তার অবদান উল্লেখযোগ্য।\r\n\r\nঅন্যদিকে বিদ্যাসাগর মহাশয় ছিলেন একজন সমাজ সংস্কারকও। বিধবা বিবাহ ও স্ত্রী শিক্ষার প্রচলন, বহুবিবাহ ও বাল্যবিবাহের মতো সামাজিক অভিশাপ দূরীকরণে তার অক্লান্ত সংগ্রাম আজও স্মরিত হয় যথোচিত শ্রদ্ধার সঙ্গে। বাংলার নবজাগরণের এই পুরোধা ব্যক্তিত্ব দেশের আপামর জনসাধারণের কাছে পরিচিত ছিলেন ‘দয়ার সাগর’ নামে। দরিদ্র, আর্ত ও পীড়িত কখনোই তার দ্বার থেকে শূন্য হাতে ফিরে যেত না। এমনকি নিজের চরম অর্থসঙ্কটের সময়ও তিনি ঋণ নিয়ে পরোপকার করেছেন‌। তার পিতামাতার প্রতি তার ঐকান্তিক ভক্তি ও বজ্রকঠিন চরিত্রবল বাংলায় প্রবাদপ্রতিম। মাইকেল মধুসূদন দত্ত তার মধ্যে দেখতে পেয়েছিলেন প্রাচীন ঋষির প্রজ্ঞা, ইংরেজের কর্মোদ্যম ও বাঙালি মায়ের হৃদয়বৃত্তি।\r\n\r\nবাঙালি সমাজে বিদ্যাসাগর মহাশয় আজও এক প্রাতঃস্মরণীয় ব্যক্তিত্ব। পশ্চিমবঙ্গের পশ্চিম মেদিনীপুরে তার স্মৃতিরক্ষায় স্থাপিত হয়েছে বিদ্যাসাগর বিশ্ববিদ্যালয়। রাজধানী কলকাতার আধুনিক স্থাপত্যের অন্যতম শ্রেষ্ঠ নিদর্শন বিদ্যাসাগর সেতু তারই নামে উৎসর্গিত। ২০০৪ খ্রিষ্টাব্দে বিবিসি বাংলা কর্তৃক পরিচালিত জরিপে সর্বকালের সর্বশ্রেষ্ঠ ২০ জন বাঙালির মধ্যে অষ্টম স্থান লাভ করেন।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-31 02:58:28',	'2023-07-31 02:58:28'),
(32,	'দীনেশচন্দ্র সেন',	'দীনেশচন্দ্র সেন',	'দীনেশচন্দ্র সেন (রায়বাহাদুর) (৩ নভেম্বর,১৮৬৬- ২০ নভেম্বর,১৯৩৯) শিক্ষাবিদ, গবেষক, লোক-সাহিত্যবিশারদ, বাংলা সাহিত্যের ইতিহাসকার। তিনি কলকাতা বিশ্ববিদ্যালয়ের রামতনু লাহিড়ী রিসার্চ ফেলো এবং এর প্রতিষ্ঠাকালীন সদস্য ছিলেন।\r\n১৮৯০-এ কুমিল্লা ভিক্টোরিয়া স্কুলের প্রধান শিক্ষকের দায়িত্ব পালন কালে গ্রামবাংলার বিভিন্ন অঞ্চল ঘুরে প্রাচীন বাংলার পুঁথি সংগ্রহ করেন এবং সেসব উপকরণের সাহায্যে ১৮৯৬-এ “বঙ্গভাষা ও সাহিত্য” শিরোনামে বাংলা সাহিত্যের ইতিহাস রচনা করেন। ১৯০৫ সালে বিনোদবিহারী কাব্যতীর্থের সহযোগিতায় শ্রীকর নন্দীর লেখা ‘ছুটিখানের মহাভারত’-এর পুঁথি এবং হরপ্রসাদ শাস্ত্রীর সহায়তায় মানিক গাঙ্গুলীর লেখা ‘শ্রীধর্মমঙ্গল’ পুঁথি দুটি দীনেশচন্দ্র সেন প্রথম প্রকাশ করেন।\r\n\r\n১৯১১ সালে তার সুবিখ্যাত গ্রন্থ “হিস্ট্রি অব বেঙ্গলি লিটেরেচার” প্রকাশিত হলে তা সর্বমহলের ভূয়সী প্রশংসা অর্জন করে। ১৯১৩ সালে কলকাতা বিশ্ববিদ্যালয় তাকে “রামতনু লাহিড়ী রিসার্চ ফেলোসিপ” প্রদান করে এবং এরই পরিপ্রেক্ষিতে তিনি মৈমনসিংহ গীতিকা ও পূর্ববঙ্গ গীতিকা সম্পাদনা করেন, যে গ্রন্থগুলোর পালাগান, গীতিকা বা কাব্যগুলো সংগ্রহ করে দেন চন্দ্রকুমার দে।\r\n\r\nপ্রধান গ্রন্থসমূহ:\r\nবঙ্গভাষা ও সাহিত্য (১ম ও ২য় খণ্ড) (১৮৯৬)\r\nতিন বন্ধু (১৯০৪)\r\nরামায়ণী কথা (১৯০৪)\r\nবেহুলা (১৯০৭)\r\nসতী (১৯০৭)\r\nফুল্লরা (১৯০৭)\r\nজড় ভরত (১৯০৮)\r\nসুকথা (১৯১২)\r\nগৃহশ্রী (১৯১৬)\r\nনীলমানিক (১৯১৮)\r\nমুক্তা চুরি (১৯২০)\r\nসরল বাংলা সাহিত্য (১৯২২)\r\nবৈদিক ভারত (১৯২২)\r\nঘরের কথা ও যুগসাহিত্য (১৯২২)\r\nআলোকে আঁধারে (১৯২৫)\r\nচৌকির বিড়ম্বনা (১৯২৬)\r\nওপারের আলো (১৯২৭)\r\nপৌরাণিকী (১৯৩৪)\r\nবৃহৎ বঙ্গ (১ম ও ২য় খণ্ড) (১৯৩৫)\r\nআশুতোষ স্মৃতি কথা (১৯৩৬)\r\nশ্যামল ও কাজল (১৯৩৬)\r\nপদাবলী মাধুর্য্য (১৯৩৭)\r\nপুরাতনী (১৯৩৯)\r\nবাংলার পুরনারী (১৯৩৯)\r\nপ্রাচীন বাঙ্গলা সাহিত্যে মুসলমানের অবদান (১৯৪০)\r\nহিন্দু সমাজ ও বৈষ্ণব ধর্ম\r\nমৈমনসিংহ গীতিকা\r\nপূর্ব্ববঙ্গ গীতিকা',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-31 03:40:49',	'2023-07-31 03:40:49'),
(33,	'জগদানন্দ রায়',	'জগদানন্দ রায়',	'জগদানন্দ রায় (১৮ই সেপ্টেম্বর ১৮৬৯-২৫শে জুন ১৯৩৩) ঊনবিংশ শতাব্দীর একজন বাঙালি বিজ্ঞান কল্পকাহিনী লেখক। তিনি শুক্র ভ্রমণ নামে একটি বই প্রকাশ করেন। এই বিজ্ঞান কল্পকাহিনীমূলক গ্রন্থ রচনার জন্যই মূলত তাকে বাংলা ভাষায় বিজ্ঞান কল্পকাহিনীমূলক সাহিত্য চর্চার অগ্রদূত হিসেবে আখ্যায়িত করা যায়। তার এই বইটি ভাষাতাত্ত্বিক ইতিহাসবিদদের জন্য বিশেষ আগ্রহের সৃষ্টি করতে পারে।\r\n\r\nবিজ্ঞান জনপ্রিয় করার উদ্দেশ্যে তিনি বেশ কিছু বই লিখেছিলেন। বৈজ্ঞানিক সত্যকে সাধারণ মানুষের সামনে তুলে ধরার তাগিদেই তিনি লেখা শুরু করেন আর লেখার আদল ছিল অনেকটা রামেন্দ্রসুন্দর ত্রিবেদীর মত। এছাড়া বিজ্ঞান কল্পকাহিনী রচনাও শুরু করেন। তার শুক্র ভ্রমণ নামক গ্রন্থের বিষয় ছিল অন্য গ্রহে মানুষের ভ্রমণ কাহিনী। মানুষ অন্য গ্রহে যাতায়াতের মাধ্যমে ইউরেনাস গ্রহে ভিনগ্রহী জীবের সাক্ষাৎ লাভ করে। সেই ভিনগ্রহী জীবের বিবর্তনের সাথে আধুনিক বিবর্তনবাদী তত্ত্বের আশ্চর্য মিল লক্ষ্য করা যায়। ভিনগ্রহী জীবের বর্ণনা দিতে গিয়ে তিনি যেসব বৈশিষ্ট্য উল্লেখ করেছেন তা হল: তারা অনেকটা আমাদের পূর্বপুরুষ বানরদের প্রতিনিধিত্ব করে। তাদের শরীর ঘন কালো পশমে ঢাকা, শরীরের তুলনায় মাথা অস্বাভাবিক রকমের মোটা, লম্বা লম্বা নখ রয়েছে এবং তারা সম্পূর্ণ নগ্ন। তার এই বর্ণনা প্রকাশিত হয় এইচ জি ওয়েল্‌সের বিখ্যাত বিজ্ঞান কল্পকাহিনী দ্য ওয়ার অব দ্য ওয়ার্ল্ডস প্রকাশিত হওয়ারও আগে। এই বইয়েও এইচ জি ওয়েল্‌স মঙ্গল গ্রহে ভিনগ্রহী জীবের বর্ণনা দিয়েছিলেন।[১]\r\n\r\nরচনাবলী\r\nপ্রকৃতি পরিচয় (১৩১৮ )\r\nআচার্য জগদীশচন্দ্রের আবিষ্কার (১৩১৯)\r\nবৈজ্ঞানিকী (১৩২০ )\r\nপ্রাকৃতিকী ( ১৩২১ )\r\nজ্ঞানসোপান (১৩২১)\r\nগ্রহণক্ষত্র ( ১৩২২ )\r\nবিচিত্র সন্দর্ভ( ১৩২৪ )\r\nসাহিত্য সন্দর্ভ ( ১৩২৪ )\r\nসুকুমার পাঠ (১৩২৫ )\r\nকনক পাঠ ( ১৩২৫ )\r\nচয়ন (১৩২৬ )\r\nপোকামাকড় (১৩২৬)\r\nবিজ্ঞানের গল্প (১৩২৭)\r\nগাছপালা (১৩২৮)\r\nসাহিত্য সোপান (১৩২৯)\r\nআদর্শ স্বাস্থ্যপাঠ (১৩৩০)\r\nআদর্শ কাহিনী ( ১৩৩০)\r\nমাছ,ব্যঙ,সাপ (১৩৩০)\r\nবাংলার পাখী (১৩৩১)\r\nশব্দ (১৩৩১)\r\nপাখী (১৩৩১ )\r\nবিজ্ঞান-প্রবেশ (১৩৩২)\r\nবিজ্ঞান-পরিচয় (১৩৩২)\r\nআলো (১৩৩৩)\r\nগদ্য ও পদ্য (১৩৩৩)\r\nসাহিত্য সৌরভ (১৩৩৩)\r\nসঞ্চয়ন (১৩৩৩)\r\nবিজ্ঞান-প্রকাশ (১৩৩৩ )\r\nস্থির বি