(35,	'উইলিয়াম কেরি',	'উইলিয়াম কেরি',	'উইলিয়াম কেরি (ইংরেজি: William Carey; ১৭৬১ – ১৮৩৪) ছিলেন একজন মিশনারি ও বাংলায় গদ্য পাঠ্যপুস্তকের প্রবর্তক, ব্রিটিশ খ্রিস্টান ধর্মপ্রচারক, যাজক, বিশেষ ব্যাপটিষ্ট মন্ত্রী, অনুবাদক, সামাজিক সংস্কারক, এবং সাংস্কৃতিক নৃতত্ত্ববিদ। তিনি ব্যাপ্টিস্ট মিশনারি সোসাইটি, প্রথম ডিগ্রী প্রদানকারী বিশ্ববিদ্যালয় ও শ্রীরামপুর কলেজ এর অন্যতম প্রতিষ্ঠাতা।\r\n\r\n১৮৩৪ সালের ৯ জুন ৭৩ বছর বয়সে উইলিয়াম কেরি নামক এই ভদ্রলোকের মহান কর্মময় জীবনের পরিসমাপ্তি ঘটে। এবং শ্রীরামপুর ব্যাপ্টিস্ট মিশনারীদের সমাধি ক্ষেত্রে তাকে সমাহিত করা হয়।',	'Writer',	'',	'',	'',	NULL,	'1',	NULL,	'2023-07-31 05:14:23',	'2023-07-31 05:14:23');
