(29,	21,	3,	2,	'ঘরে-বাইরে',	'রবীন্দ্রনাথ ঠাকুর - ঘরে-বাইরে',	NULL,	'ঘরে-বাইরে (১৯১৬) রবীন্দ্রনাথ ঠাকুর রচিত একটি উপন্যাস। এটি চলিত ভাষায় লেখা রবীন্দ্রনাথের প্রথম উপন্যাস। উপন্যাসটি ১৯১৬ সালে সবুজপত্র পত্রিকায় প্রকাশিত হয়। স্বদেশী আন্দোলনের পটভূমিকায় রচিত এই উপন্যাসে একদিকে আছে জাতিপ্রেম ও সংকীর্ণ স্বাদেশিকতার সমালোচনা, অন্যদিকে আছে সমাজ ও প্রথা দ্বারা নিয়ন্ত্রিত নারী পুরুষের সম্পর্ক; বিশেষত পরস্পরের আকর্ষণ-বিকর্ষণের বিশ্লেষণ।\r\n\r\nঘরে-বাইরে রবীন্দ্রনাথ ঠাকুর রচিত একটি রাজনৈতিক উপন্যাস। বঙ্গভঙ্গ আন্দোলনের পটভূমিতে রচিত এই উপন্যাসের প্রকাশকাল ১৯১৬। ১৯৮৪ সালে প্রখ্যাত ভারতীয় চিত্রপরিচালক সত্যজিৎ রায় এই উপন্যাসটি চলচ্চিত্রায়িত করেন।',	'pdf',	NULL,	'Uponyas, Novel, রবীন্দ্রনাথ ঠাকুর , ঘরে-বাইরে',	'5',	'Porua',	'2023-07-19',	'/tmp/phprKKJSi',	NULL,	NULL,	NULL,	NULL,	102,	100,	80,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-05-04 00:23:27',	'2024-01-15 04:24:07'),
