(47,	6,	NULL,	1,	'Saifur\'s IBA & Bank Math',	'Saifur\'s IBA & Bank Math',	NULL,	'Saifur\'s (IBA & BANK) Math book is very important for the JOB/BCS/MBA/ admissions in universities, NSU, BRAC, private university, GRE, GMAT, etc.\r\n\r\n\r\nTo get 100% of math common in different competitive exam, although, if you solve 40/45 math chapters, only 20/25 math questions at maximum come in the exam. Moreover, these 20/25 questions seem difficult to solve during the exam. Therefore, S@ifurs Math book is designed with questions that are most likely to come in the exams.\r\n\r\n\r\nTo remain ahead of everyone by getting a 100% common in math in competitive examinations, abide by S@ifurs Math book.',	'pdf',	NULL,	'Saifur\'s Book',	'2',	'Saifur\'s Publication Ltd.',	'2024-01-01',	'/tmp/phpcOlTSV',	NULL,	NULL,	'/tmp/phpMrBklo',	'/tmp/phpDcpn9D',	584,	100,	175,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-05-23 00:28:09',	'2024-01-21 04:39:56'),
