(49,	5,	NULL,	1,	'S@ifur\'s হাতে-কলমে Reading Skills',	'S@ifur\'s হাতে-কলমে Reading Skills',	NULL,	'S@IFUR\'S হাতে-কলমে READING SKILLS\r\n\r\nTurn your confusion regarding Bank Job, BCS, IBA and IELTS Reading into your passion. To practical solving of Reading skills include breaking down large passages into small sentences and explaining the fragments with respective Bangla meanings.\r\n\r\nThis book also has:\r\n*Solution of Reading passage by breaking down sentences.\r\n*Techniques to solve BCS Written questions in an exam approach.\r\n*Tips and Tricks to solve Reading passages quickly and easily.',	'pdf',	NULL,	'Saifur\'s Book',	'2',	'Saifur\'s Publication Ltd.',	'2024-01-01',	'/tmp/php4U6YGp',	NULL,	NULL,	'/tmp/phpeACTbg',	'/tmp/phpeXQ31j',	464,	100,	175,	0,	0,	0,	'1',	0,	1,	NULL,	'2023-05-31 05:00:56',	'2024-01-21 04:44:49'),
