(52,	8,	NULL,	1,	'JSC Protiva | জেএসসি প্রতিভা',	'JSC Protiva | জেএসসি প্রতিভা',	NULL,	'S@ifur\'s Talent JSC English book is very useful for students of 8th standard . This is an incomparable book for Academic Syllabus and JSC All Question\r\n\r\n\r\nThe effective benefits of this book are given below:\r\n1. Starting from seen, unseen passages & writing parts everything is arranged in this book.\r\n2. Every question is very well explained in detail.\r\n3. Each line is explained step by step with Bengali meaning.\r\n4. JSC Various year questions solved elaborately with detailed explanations.\r\n5. Creative essay writing ideas.\r\n6. Creative ways/steps to write “Dialogues” & each step is well explained.\r\n\r\n\r\nHopefully, no extra private coaching is necessary for 8th standard students if they study this book.\r\n\r\nSo, students of class 8 without further delay purchase this book now!',	'pdf',	NULL,	'Saifur\'s Book',	'2',	'Saifur\'s Publication Ltd.',	'2024-01-01',	'/tmp/phpZLkuDX',	NULL,	NULL,	'/tmp/php8EzAOG',	'/tmp/php7XWWgI',	652,	100,	100,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-06-20 23:55:22',	'2024-01-21 04:36:42'),
(53,	2,	NULL,	1,	'কোচিং ছাড়াই স্পোকেন ইংলিশ | Coaching Charai Spoken English',	'কোচিং ছাড়াই স্পোকেন ইংলিশ | Coaching Charai Spoken English',	NULL,	'The book \"Spoken English without Coaching\" is an effective book for learning English without any one’s help. If you want to learn English but don\'t have time to do coaching or don\'t want to spend money for coaching, this book can be very useful for you. This book teaches you how to become advanced by practicing day to day starting from a very basic level.\r\n\r\nIn this book, how to speak English in different situations is explained very nicely, Saifur Rahman Khan Sir\'s numerous tips and tricks The journey of learning English will be interesting, at the end of the book there are different words, pronunciation, meanings of the word, past form, Past participle form, different techniques for making English sentences easier, various competitive exams have marked the questions of the past year separately.\r\n\r\n\r\nSo if you are a beginner learning English, and want to learn spoken English with interest, this book will help you to take you from beginner to advanced level in sha Allah, order the book \"Spoken English without Coaching\" without delay.',	'pdf',	NULL,	'Saifur\'s Book',	'2',	'Saifur\'s Publication Ltd.',	'2024-01-01',	'/tmp/phpIgXvjn',	NULL,	NULL,	'/tmp/phpMHdioX',	'/tmp/phpq6GSh7',	208,	100,	100,	0,	0,	0,	'1',	1,	0,	NULL,	'2023-06-21 00:04:55',	'2024-01-21 04:41:07'),
(54,	20,	1,	9,	'The Tales of Ken And Ava\'s Forest Adventure',	'The Tales of Ken And Ava\'s Forest Adventure',	NULL,	'In a quiet and cozy corner of a small town similar to yours, where vast green\r\nfields and trees stretched as far as the eye could see, lived two braves and\r\nadventurous siblings named ken and Ava. Filled with boundless energy and an\r\ninsatiable desire for excitement, they embarked on an extraordinary adventure\r\none sunny day that would forever change their lives.',	'pdf',	NULL,	'Tales',	'2',	'Porua',	'2023-08-01',	'/tmp/phpEXvMoc',	'/tmp/phpF3tieY',	NULL,	'/tmp/phpQmm0HK',	'/tmp/phpCQkfhn',	16,	100,	0,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-07-03 06:36:00',	'2023-08-07 05:21:35'),
(55,	20,	1,	9,	'The Enchanting Ladybug and The Scroll',	'The Enchanting Ladybug and The Scroll',	NULL,	'Ken and Ava venture into an enchanted forest\r\nwhere they are captivated by a beautiful\r\nladybug. Following the ladybug, they discover a\r\nmagical clearing filled with glowing mushrooms\r\nand a family of ladybugs. One special ladybug\r\ngifts them a scroll containing ancient wisdom\r\nand secret knowledge. Inspired by this\r\nencounter, Ken and Ava embrace the magic\r\nwithin themselves and learn to appreciate the\r\nbeauty and uniqueness of every living creature.\r\nThey set off on an extraordinary adventure,\r\nready to face challenges and discover more\r\nenchanting surprises in the forest. The\r\nencounter with the ladybugs teaches them to\r\nvalue all living beings and find unexpected\r\ntreasures in nature.',	'pdf',	NULL,	'Tales',	'2',	'Porua',	'2023-08-02',	'/tmp/phpyzddIn',	'/tmp/phpUoEVl1',	NULL,	'/tmp/phpJz6di7',	'/tmp/php0XpDGo',	12,	100,	68,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-07-03 06:40:29',	'2024-01-15 04:19:01'),
(56,	20,	1,	9,	'Conversing With the Tree',	'Conversing With the Tree',	NULL,	'Ken and Ava explore the enchanted forest\r\nand encounter talking trees. The trees guide\r\nthem to prove their bravery and kindness by\r\nfacing trials set by guardians such as the\r\nwise owl. They pass the owl\'s test by\r\nanswering riddles, demonstrating their\r\nknowledge and curiosity. Renewed with\r\nconfidence, they continue their journey,\r\nunaware of the greater challenges that\r\nawait them. The quest emphasizes the\r\nimportance of curiosity, continuous\r\nlearning, bravery, and kindness, shaping\r\ntheir destinies and revealing the\r\nenchantment of the forest',	'pdf',	NULL,	'Tales',	'2',	'Porua',	'2023-08-03',	'/tmp/phpqiQJGM',	'/tmp/phpS3HJRw',	NULL,	'/tmp/phpfvd9eV',	'/tmp/phpPGktOp',	12,	100,	68,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-07-03 06:43:49',	'2024-01-15 04:18:41'),
(57,	20,	1,	9,	'THE MISCHIEF OF THE SQUIRREL AND ITS REVELATION',	'THE MISCHIEF OF THE SQUIRREL AND ITS REVELATION',	NULL,	'Ken and Ava encounter a lively family of squirrels\r\nin the enchanted forest. They join in a game of\r\nhide-and-seek with acorns and learn about the\r\nsquirrels\' secret stories and the forest\'s hidden\r\ntreasures. Guided by Sammy the squirrel, they\r\nface challenges posed by wise owls, graceful deer,\r\nand melodious songbirds. Their bond with Sammy\r\nstrengthens as they appreciate nature\'s harmony.\r\nThey eventually unlock a treasure chest,\r\ndiscovering the true treasure of friendship,\r\nteamwork, and the interconnectedness of all living\r\ncreatures. Through their adventures, they learn\r\nlessons about wisdom, patience, and the power of\r\nmusic. Their exploration continues, filled with\r\nwonder, as they cherish the simple moments and\r\nembrace the magic of the world around them.',	'pdf',	NULL,	'tales',	'2',	'Porua',	'2023-08-03',	'/tmp/php2L63OW',	'/tmp/phpXeQDS6',	NULL,	'/tmp/phpMe5kUU',	'/tmp/phpQ9yaJy',	12,	100,	68,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-07-03 06:46:01',	'2024-01-15 04:18:21'),
(58,	20,	1,	9,	'HOME AT LAST',	'HOME AT LAST',	NULL,	'In summary, Ken and Ava find themselves lost\r\nin an enchanted forest. They encounter the\r\nfeared Gungie Gungie Gee monster but manage\r\nto hide from it. They eventually spot their pool\r\nhouse in the distance and realize they are\r\ncloser to home than they thought. They use\r\nmagic fairy dust to return to their normal size\r\nand make it back home just in time for dinner.\r\nAlthough they keep their adventures a secret,\r\nthey cherish the memories and plan to continue\r\ntheir quests in the enchanted forest. The story\r\nemphasizes values such as perseverance,\r\ngratitude, resourcefulness, respect, knowledge,\r\ncuriosity, family, and embracing the journey of\r\nlife.',	'pdf',	NULL,	'tales',	'2',	'Porua',	'2023-08-03',	'/tmp/phpNGh4XO',	'/tmp/phpzK9z7R',	NULL,	'/tmp/phpd5TPNZ',	'/tmp/php9C3dg6',	15,	100,	68,	0,	0,	0,	'1',	0,	0,	NULL,	'2023-07-03 06:49:00',	'2024-01-15 04:17:54'),
